import classes from './Modal.module.css';
import Card from '../UserInterface/Card';
import { Link } from 'react-router-dom';
import { useFormik } from "formik";
import { useState } from 'react';
import Signupmodal from '../Signupthingys/Signupmodal';
import Backdrop from '../UserInterface/Backdrop';

function Modal(props){
    const click = props.clickButtons;
    const [signupisOpen, setsignupisOpen] = useState(false);

    function showSignuppage(){
        setsignupisOpen(true);
    }

    function removeSignuppage(){
        setsignupisOpen(false);
    }
    const formik = useFormik({
        initialValues: {
            Email: '',
            Password: ''
        },
        onSubmit: values => {
            console.log(values);
        }
    });

    function firefunction() {
        click();
        props.loginclick();
    }
    // console.log(formik.values, formik.Email.values);

    return (
        <Card>
        <div className={classes.modal}>
            <p>
                Login Here
            </p>
            <div>
                <form onSubmit={formik.handleSubmit}>
                    <div>
                        <label className={classes.criteria1} htmlFor='email'>Enter your IITG mail-id</label>
                        <br />
                        <input 
                        className={classes.input1} 
                        id='email' 
                        name='Email' 
                        type="email" 
                        placeholder="include@iitg.ac.in" 
                        required 
                        onChange={formik.handleChange}
                        value={formik.values.Email}/>
                    </div>
                    <div>
                        <label className={classes.criteria2} htmlFor='pass'>Enter Password</label>
                        <br />
                        <input 
                        className={classes.input2} 
                        id='pass'
                        name='Password'
                        type="password"
                        placeholder='********'
                        required 
                        onChange={formik.handleChange}
                        value={formik.values.Password}/>
                    </div>
                </form>
            </div>
            <div>
                <button type='submit' className={classes.btn} onClick={firefunction}>Login</button>
            </div>
            <div>
                <Link to='/'>
                    Forgot Password?
                </Link>
            </div>
            <div>
                <Link to='/'>
                    <button type='button' onClick={showSignuppage}>Create New Account</button>
                </Link>
            </div>
            {signupisOpen ? <Signupmodal clickButtons={removeSignuppage}  /> : null}
            {signupisOpen ? <Backdrop clickBackdrop={removeSignuppage} /> : null}
        </div>
        </Card>
    );
}
 
export default Modal;
